function buildView(element, props) {
  // index of map element in the layers
  const invisible = 1;
  const visible = 2;

  var year = 2000;

  if (props.hasOwnProperty("currentYear")) {
    year = props.currentYear;
  } else {
    // props.hasOwnProperty("currentStep")
    year = props.currentStep*10 + 1965;
  }

  //alert(JSON.stringify(props));


  const left = "datum.year == ";
  const right = year.toString();
  const term = left.concat(right);
  var transform = [{"filter":term}];

  // alert(JSON.stringify(spec.layer[visible].transform));

  // alert(JSON.stringify(spec.layer[visible].mark));
  
  spec.layer[invisible].transform = transform;
  spec.layer[visible].transform = transform;


  var tooltip = new vegaTooltip.Handler();
  var runtime = vega.parse(vegalite.compile(spec).spec)
  var view = new vega.View(runtime)
    .renderer('svg')
    .initialize(element.node())
    .tooltip(tooltip.call);

  return view;
}
